import { useState, useEffect } from "react";
import { CardBody, Card, CardText, CardSubtitle, CardTitle, CardImg } from "reactstrap";
import { getList } from "../../utilities/api";
import { IPost } from "../../model/IPost";
import React from "react";

interface IPostProps {
    post: IPost
}

export class PostCardComponent extends React.PureComponent<IPostProps> {
  render() {
    return (
      <Card>
        <CardImg>{this.props.post.image}</CardImg>
          <CardBody>
            <CardTitle>{props.post.title}</CardTitle>
            {/*Display category_name here*/}
            <CardSubtitle>{props.post.category_post_id}</CardSubtitle>
            {/*Multiple Cardtexts to be tested if it works*/}
            <CardText>{props.post.ingredients}</CardText>
            <CardText>{props.post.recipe}</CardText>
            <CardText>{props.post.postSubmitted}</CardText>
          </CardBody>
      </Card>
    );
  }
}
